function Card(props) {
  return (
    <li className="concept">
      <img src={props.concepts[0].image} alt={props.concepts[0].title} />
      <h2>{props.concepts[0].title}</h2>
      <p>{props.concepts[0].description}</p>
    </li>
  );
}

export default Card;
